import "./Nav.scss";
import NavLogo from "../atoms/NavLogo/NavLogo";
import NavMenu from "../molecules/NavMenu/NavMenu";
import NavDropdownMenu from "../molecules/NavDropdownMenu/NavDropdownMenu";

const Nav = () => {
    const navMenuItems = [
        {
            label: "Books",
            link: "/home"
        },
        {
            label: "Illustrations",
            link: "/illustrations"
        },
        {
            label: "Blog",
            link: "/blog"
        },
        {
            label: "About",
            link: "about"
        },
        {
            label: "Contact",
            link: "contact"
        }
    ];

    return (
        <nav className="nav">
            <NavLogo />
            <div>

            </div>

            <div>
                <NavMenu navMenuItems={navMenuItems} />
            </div>

            <NavDropdownMenu navMenuItems={navMenuItems} />
        </nav>
    );
};

export default Nav;
